import { setupSubmission, 
    useLazyFetchSubmissionQuery, 
} from "../store";
import { useDispatch } from "react-redux";
import { useEffect } from "react";

function TryLoadUserSubmission(user)
{
    const [fetchSubmission, results] = useLazyFetchSubmissionQuery(user);
    const dispatch = useDispatch();

    // Filter and dispatch loaded user questions
    useEffect(() => {
        if(user.id == 0) return;
        if(results.isFetching ||
            results.isLoading ||
            results.error) return;

        dispatch(setupSubmission(fetchSubmission.data[0]));
        // console.log('loaded submission to slice');
        // console.log(fetchSubmission.data[0]);

    }, [fetchSubmission]);

    return [fetchSubmission.isLoading, fetchSubmission.error];
}

export default TryLoadUserSubmission;
